            </div>

</div>
<script>
// Metadaten der Grafiken
var groups = [{cat: "ges", label: "Gesamt", serie: ["0", "1", "2", "3"], typ_label: "", typ: ["Gesamt"]},
            {cat: "gk", label: "nach ZRS-Zonen", serie: ["0", "1", "2", "3"], typ_label: "ZRS-Zone", typ: ["GK 1", "GK 2", "GK 3", "GK 4"]},
            {cat: "plz", label: "nach Postleitzahlbereichen", serie: ["0", "1", "2", "3"], typ_label: "PLZ-Bereich", typ: ["0xxxx", "1xxxx", "2xxxx", "3xxxx", "4xxxx", "5xxxx", "6xxxx", "7xxxx", "8xxxx", "9xxxx"]},
            {cat: "fezg", label: "nach Flusseinzugsgebieten", serie: ["0", "1", "2", "3"], typ_label: "Flusseinzugsgebiet", typ: ["Donau", "Rhein", "Ems", "Weser", "Elbe", "Oder"]}];
// Funktion gibt Index zurck
function getIndex(cat){
    for(ii=0;ii<4;ii++){
        if(groups[ii].cat==cat){ return ii; }
    }
};
// Rnder und Gre der Grafik
var margin = {top: 20, right: 40, bottom: 20, left: 80},
    width = 900 - margin.left - margin.right,
    height = 450 - margin.top - margin.bottom;
// Funktionen fr Formatierung des Mauszeiger-Tooltips
function formatNumber(x) {
    return x.toString().replace(".", ",").replace(/\B(?=(\d{3})+(?!\d))/g, ".");
}
// Formatierung der Achsenbeschriftung
var germanFormatters = d3.formatLocale({
    "decimal": ",",
    "thousands": ".",
    "grouping": [3]
});
var logFormat = germanFormatters.format(".0f");
var saufFormat = germanFormatters.format(",.0f");

// Funktion gibt Datenselektion zurck
function returnResults(data, serien, typen) {
    var results = typen.map(function(typ) {
        return {
            typ: typ,
            values: serien.map(function(serie) {
                return {
                    typ: typ,
                    serie: serie,
                    values: data.filter(function(d) {
                        return d.serie==serie & d.typ==typ;
                    })
                }
            })
        };
    });
    return results;
};
// fr Zoom-Funktion
function zoomed(cat, ii) {
    return function() {
        var plt = d3.select("#plt_"+cat),
            t = d3.event.transform;
        // Restriktion auf geeigenten Definitionsbereich
        if(t.invertX(0) < -80) t.x = 80*t.k;
        if(t.invertX(width) > 1280) t.x = width - 1280*t.k;
        plt.selectAll(".typ")
            .attr("transform", t);
        plt.selectAll(".line")
            .style("stroke-width", 2/t.k)
            .style("stroke-dasharray", function(d) { return 5*d.serie/t.k; });
        plt.selectAll("circle")
            .attr("r", 5/t.k);
        plt.selectAll(".axis").filter(".x").call(xAxis[ii].scale(t.rescaleX(x[ii])));
        plt.selectAll(".axis").filter(".y").call(yAxis[ii].scale(t.rescaleY(y[ii])));
        plt.selectAll(".grid").filter(".x").call(
            d3.axisBottom(t.rescaleX(x[ii]))
                .tickSize(-height)
                .tickFormat(""));
        plt.selectAll(".grid").filter(".y").call(
            d3.axisLeft(t.rescaleY(y[ii]))
                .tickSize(-width)
                .tickFormat(""));
    }
}        
var zoom = [];
// leere Arrays fr Skalen
var x = [],
    y = [],
    colors = [];
// leere Arrays fr Achsen und Linien
var xAxis = [],
    yAxis = [],
    line = [];

// Funktion erzeugt Grafiken nachdem alle Daten gestreamed wurden
function showResults(data) {
    // Parsen der Daten
    var all_results = d3.csvParse(data, function(d) {
        return {
            serie:d.serie,
            typ:d.typ,
            tn:+d.tn, 
            sauf:+d.sauf,
        };
    });
    // Erzeuge Reitermen
    var menu = d3.select("ul.nav")
        .selectAll("li")
        .data(groups);
    menu.enter().append("li")
        .attr("class", function(d, i){ if (i==0){ return "active";}})
        .append("a")
            .attr("data-toggle", "tab")
            .attr("href", function(d) { return "#"+d.cat; })
            .text(function(d) { return d.label; });
    // Erzeuge Inhalte der Reiter
    var tabs = d3.select("div.tab-content")
        .selectAll("div.tab-pane")
        .data(groups)
        .enter().append("div")
            .attr("class", function(d, i){
                cl = "tab-pane fade";
                if(i==0){
                    cl += " active in";
                }
                return cl;
            })
            .attr("id", function(d){ return d.cat; })
    // Schleife zur Erzeugung der Grafiken
    for(ii=0;ii<4;ii++){
        // Filtern der Daten
        results = returnResults(all_results, groups[ii].serie, groups[ii].typ);
        // Berechne y-Range
        max_range = 0
        for(r in results){
            val = results[r].values[0].values[10].sauf;
            if(val>max_range){ max_range = val; }
        }
        // Skalen fr x- und y-Achse, sowie Farbgebung
        x[ii] = d3.scaleLog()
            .base(10)
            .domain([5, 500])
            .range([0, width]);
        y[ii] = d3.scaleLinear()
            .domain([0, 1.1*max_range])
            .range([height, 0]);
        colors[ii] = d3.scaleOrdinal(d3.schemeSet2)
            .domain(groups[ii].typ);
        
        var tab = d3.select("#"+groups[ii].cat);
        // Auswahlmen fr Serien
        var sel_serie = tab.append("div")
            .attr("class", "form-group row")
            .attr("id", function(d){ return "select_serie_"+d.cat; });
         // Beschreibungstext
         sel_serie.append("label")
            .attr("class", "col-md-4 control-label")
            .attr("for", "checkboxes")
            .text("Auswahl Simulationsserie");
         // Fge Checkboxen ein
         sel_serie.append("div")
            .attr("class", "col-md-8")
            .selectAll("label.checkbox-inline")
            .data(function(d){ return d.serie; })
            .enter().append("label")
                .attr("class", function(d){
                    if(d==0){
                        return "checkbox-inline disabled";
                    }else{
                        return "checkbox-inline";
                    }
                })
                .html(function(d){ 
                    if(d==0){
                        return '<input type="checkbox" value="'+d+'" checked disabled>Mittelwert';
                    }else{
                        return '<input type="checkbox" value="'+d+'">Serie '+d;
                    }
                });
         // Linestyle passend zu den Graphen als Legende
         sel_serie.selectAll(".checkbox-inline")
            .append("svg")
            .attr("width", 60)
            .attr("height", 5)
            .append("line")
            .attr("x1", 5)
            .attr("x2", 55)
            .style("stroke", "#000")
            .style("stroke-width", "4px")
            .each(function(d, i) { d3.select(this).style("stroke-dasharray", 5*i); });
         // Auswahlmen fr Typen
         var sel_typ = tab.append("div")
            .attr("class", "form-group row")
            .attr("id", function(d){ return "select_typ_"+d.cat; });
         // Beschreibungstext
         sel_typ.append("label")
            .attr("class", "col-md-4 control-label")
            .attr("for", "checkboxes")
            .text(function(d){ return "Auswahl "+d.typ_label; });
         // Fge Checkboxen ein (in passender Farbe als Legende)
         sel_typ.append("div")
            .attr("class", "col-md-8")
            .selectAll("label.checkbox-inline")
            .data(function(d){ return d.typ; })
            .enter().append("label")
                .attr("class", "checkbox-inline")
                .style("color", function(d){ return colors[ii](d); })
                .html(function(d){ return '<input type="checkbox" value="'+d+'" checked>'+d; });
        // SVG hinzufgen
        svg = tab.append("div")
            .attr("class", "row")
            .append("div")
                .attr("class", "col-md-12 plot")
                .append("svg")
                    .attr("id", function(d){ return "plt_"+d.cat; })
                    .attr("width", width + margin.left + margin.right)
                    .attr("height", height + margin.top + margin.bottom)
                    .append("g")
                        .attr("transform", "translate(" + margin.left + "," + margin.top + ")");
        // fr Zoom-Funktionalitt
        zoom[ii] = d3.zoom()
            .scaleExtent([0.7, 10])
            .on("zoom", zoomed(groups[ii].cat, ii));
        d3.select("#plt_"+groups[ii].cat)
            .call(zoom[ii]);
        // Achsenbeschriftung
        svg.append("text")
            .attr("class", "axislabel")
            .attr("text-anchor", "end")
            .attr("y", 6)
            .attr("dy", ".75em")
            .attr("transform", "rotate(-90)")
            .text("Schadenaufwand in TEUR");
        svg.append("text")
            .attr("class", "axislabel")
            .attr("text-anchor", "end")
            .attr("x", width)
            .attr("y", height+6)
            .attr("dy", "-.75em")
            .text("Jhrlichkeit");
        // fge x-Achse zum SVG hinzu
        xAxis[ii] = d3.axisBottom(x[ii])
            .tickFormat(x[ii].tickFormat(8, logFormat));
        svg.append("g")
            .attr("class", "x axis")
            .attr("transform", "translate(0," + height + ")")
            .call(xAxis[ii]);
        // fge y-Achse zum SVG hinzu
        yAxis[ii] = d3.axisLeft(y[ii])
            .tickFormat(saufFormat);
        svg.append("g")
             .attr("class", "y axis")
             .call(yAxis[ii]);
        // x-Gitterlinien
        svg.append("g")			
            .attr("class", "x grid")
            .attr("transform", "translate(0," + height + ")")
            .call(d3.axisBottom(x[ii])
                .tickSize(-height)
                .tickFormat("")
            );
        // y-Gitterlinien
        svg.append("g")			
            .attr("class", "y grid")
            .call(d3.axisLeft(y[ii])
                .tickSize(-width)
                .tickFormat("")
            );
        // Gruppierung fr jeden Typ
        var typ = svg.selectAll(".typ")
            .data(results)
            .enter().append("g")
                .attr("class", "typ");
        // Gruppierung fr jede Serie
        var serie = typ.selectAll(".serie")
            .data(function(d) { return d.values; })
            .enter().append("g")
                .attr("class", "serie");
        // Erstelle Generator zur Erzeugung des Graphen
        line[ii] = d3.line()
            .x(function(d) { return x[ii](d.tn); })
            .y(function(d) { return y[ii](d.sauf); })
            .curve(d3.curveMonotoneX);
        // fge Pfad des Graphen zum SVG hinzu
        serie.append("path")
            .attr("class", "line")
            .attr("d", function(d) { return line[ii](d.values); })
            .style("stroke", function(d) { return colors[ii](d.typ); })
            .style("stroke-dasharray", function(d) { return 5*d.serie; })
            .style("stroke-opacity", function(d) { return (d.serie>0) ? 0 : 1; });
        // EventListener fr checkbox onChange Typ
        d3.select("#select_typ_"+groups[ii].cat).selectAll("input").on("change", function() {
            var selected = this.value;
            var cat = this.parentNode.parentNode.parentNode.id.substring(11);
            opacity = this.checked ? 1 : 0;
            d3.select("#plt_"+cat).selectAll(".typ")
                .filter(function(d) {return selected == d.typ;})
                .transition()
                    .duration(500)
                    .style("opacity", opacity);
        });
        // EventListener fr checkbox onChange Serie
        d3.select("#select_serie_"+groups[ii].cat).selectAll("input").on("change", function() {
            var selected = this.value;
            var cat = this.parentNode.parentNode.parentNode.id.substring(13);
            opacity = this.checked ? 1 : 0;
            d3.select("#plt_"+cat).selectAll(".serie")
                .filter(function(d) {return selected == d.serie;})
                .selectAll(".line")
                .transition()
                    .duration(500)
                    .style("stroke-opacity", opacity);
        });
        // Gruppierungselement fr Tooltip
        var focus = svg.append("g")
            .attr("id", "tooltip")
            .style("display", "none");
        // Tooltip Kreis
        focus.append("circle") 
            .attr("class", "tooltip "+groups[ii].cat)
            .style("fill", "none") 
            .attr("r", 4);
       // Tooltip x-Achse
        focus.append("line")
            .attr("class", "tooltip x "+groups[ii].cat)
            .attr("y1", 0)
            .attr("y2", height);
        // Tooltip y-Achse
        focus.append("line")
            .attr("class", "tooltip y "+groups[ii].cat)
            .attr("x1", 0)
            .attr("x2", width);
        // Tooltip Beschriftung Jhrlichket
        focus.append("text")
            .attr("class", "tn "+groups[ii].cat)
            .attr("dx", 8)
            .attr("dy", "1em");    
        focus.append("text")
            .attr("class", "sauf "+groups[ii].cat)
            .attr("dx", 8)
            .attr("dy", "-.3em");
        // Rechteck um Mausbewegung zu erkennen
        svg.append("rect")
            .attr("class", groups[ii].cat)
            .attr("width", width)
            .attr("height", height)
            .style("fill", "none")
            .style("pointer-events", "all")
            .on("mouseover", function() { d3.select("#plt_"+this.className.baseVal).select("#tooltip").style("display", null); })
            .on("mouseout", function() { d3.select("#plt_"+this.className.baseVal).select("#tooltip").style("display", "none"); })
            .on("mousemove", function() {
                var cat = this.className.baseVal,
                    ii = getIndex(cat),
                    zoomTrans = d3.zoomTransform(d3.select("#plt_"+cat).node()),
                    x0 = d3.mouse(this)[0],
                    y0 = d3.mouse(this)[1];
                var plt = d3.select("#plt_"+cat);
                plt.select("circle.tooltip").filter("."+cat)
                    .attr("transform", "translate(" + x0 + "," + y0 + ")");
        		plt.select("line.tooltip.x").filter("."+cat)
        		    .attr("transform", "translate(" + x0 + "," + 0 + ")");
        		plt.select("line.tooltip.y").filter("."+cat)
        		    .attr("transform", "translate(" + 0 + "," + y0 + ")");
        		plt.select("text.tn").filter("."+cat)
                    .attr("transform", "translate(" + (x0+5) + "," + y0 + ")")
        		    .text(formatNumber(Math.round(10*x[ii].invert((x0-zoomTrans.x)/zoomTrans.k))/10));
        		plt.select("text.sauf").filter("."+cat)
                    .attr("transform", "translate(" + (x0+5) + "," + y0 + ")")
        		    .text(formatNumber(Math.round(y[ii].invert((y0-zoomTrans.y)/zoomTrans.k))));
            });
    }
    // Marker fr historische Ereignisse
    hist_results = all_results.filter(function(d) { return d.typ=="historische Ereignisse"; });
    var hist = d3.select("#plt_ges")
        .select("g")
        .append("g")
            .attr("class", "typ")
    // div fr Tooltip
    var tip = d3.select("body").append("div")
        .attr("class", "tip")
        .style("opacity", 0);
    var showHist = true;
    // Darstellung als Punkte im Diagramm
    hist.selectAll("hist")
        .data(hist_results)
        .enter()
            .append("circle")
                .attr("class", "hist")
                .attr("cx", function(d) { return x[0](d.tn); })
                .attr("cy", function(d) { return y[0](d.sauf); })
                .attr("r", 5)
                .on("mouseover", function(d){
                    console.log(this.style.opacity);
                    if(showHist){
                        var zoomTrans = d3.zoomTransform(d3.select("#plt_ges").node());
                        d3.select(this).attr("r", 10/zoomTrans.k);
                        tip.html("Ereignis vom: "+d.serie+"<br />Schadenaufwand: "+formatNumber(Math.round(d.sauf))+"<br />Jhrlichkeit: "+formatNumber(d.tn));
                        tip.style("opacity", 1)
                            .style("left", (d3.event.pageX - 150) + "px")
                            .style("top", (d3.event.pageY - 85) + "px");	
                    }
                })
                .on("mouseout", function(d){
                    var zoomTrans = d3.zoomTransform(d3.select("#plt_ges").node());
                    d3.select(this).attr("r", 5/zoomTrans.k)
                    tip.style("opacity", 0)
                        .style("left", 0+"px")
                        .style("top", 0+"px");
                })
                .style("fill", "rgb(252, 141, 98)");
    // Fge Checkbox ein (in passender Farbe als Legende)
    d3.select("#select_typ_ges").select("div.col-md-8")
        .append("label")
            .attr("class", "checkbox-inline")
            .style("color", "rgb(252, 141, 98)")
            .html('<input type="checkbox" value="hist" checked>historische Ereignisse');
    // EventListener
    d3.select("#select_typ_ges").select("label:nth-child(2)").select("input").on("change", function() {
        opacity = this.checked ? 1 : 0;
        showHist = this.checked;
        hist.transition()
            .duration(500)
            .style("opacity", opacity);
    });
}
</script>
</body>
<script>
$( document ).ready(function() {
    showResults(data);
    $("div#container").fadeIn(500);
});
</script>
</html>
